import bootstrap from 'bootstrap';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h2>Welcome to ReadingAid</h2>
        <div className="Login-form-container">
          <input name="username"></input>
          <input name="email"></input>
          <input name="password"></input>
        </div>
      </header>
    </div>
  );
}

export default App;
